import React from 'react';
import { Link } from 'react-router-dom';
import { FaSearch, FaShoppingCart, FaEnvelope } from 'react-icons/fa';
import SearchBar from './SearchBar';

const Navbar = () => {
  return (
    <nav style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '1rem' }}>
      {/* Logo on the left */}
      <div>
        <Link to="/">
          {/* <img src="logo.png" alt="Prizmpix Logo" style={{ height: '40px' }} /> */}
          <span style={{ fontSize: '24px', fontWeight: 'bold' }}>Prizmpix</span>
        </Link>
      </div>

      {/* Navigation links in the middle */}
      <ul style={{ listStyle: 'none', display: 'flex', justifyContent: 'space-between', alignItems: 'center', margin: '0 auto' }}>
        <li style={{ marginRight: '20px' }}><Link to="/">Home</Link></li>
        <li style={{ marginRight: '20px' }}><Link to="/services">Services</Link></li>
        <li style={{ marginRight: '20px' }}><Link to="/about">About</Link></li>
        <li><Link to="/collaboration">Collaboration</Link></li>
        <li style={{ marginRight: '20px' }}><Link to="/portfolio">Portfolio</Link></li>
      </ul>

      {/* Icons/links on the right */}
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
        <Link to="/contact" style={{ marginRight: '20px' }}><FaEnvelope size={24} /></Link>
          <button style={{ backgroundColor: 'transparent', border: 'none', cursor: 'pointer', marginRight: '20px' }} onClick={handleSearchIconClick}>
            <FaSearch size={24} />
          </button>
        <Link to="/cart"><FaShoppingCart size={24} /></Link>
      </div>
      {showSearch && <SearchBar />}
    </nav>
  );
};

export default Navbar;
